import React from "react";
import Navigation2 from "./Navigation2";
import logo from '../assets/img.png'; // Importez votre image

const Transition = () => {
  return (
    <div>
      <img src={logo} className="img" alt="Logo" /> {/* Ajoutez votre image ici */}
      <div className="rectangle">
        <div className="police">
          <h1> Découvrez leur profil et témoignage</h1>
          <ol className="bg">
            <li>
              <Navigation2 />
            </li>
            <li>Publier</li>
          </ol>
        </div>
      </div>
    </div>
  );
};

export default Transition;
